import './index.scss'
import { useNavigate } from 'react-router-dom'

export default function Cabecalho({}) {

    const navigate = useNavigate();

    function logOff() {
        localStorage.removeItem('TOKEN');
        navigate('/');
    }

    return (
        <header className='cabecalho'>
            <div className='cabecalho-logo'>
                <h1>DEV<p>HUB</p></h1>

            </div>
        </header>
    )
}
